      greens: {
        g1: '#f1fffb',
        g2: '#d9f9ef',
        g3: '#b2f5df',
        g4: '#72edc4',
        g5: '#00df94',
      },
      grays: {
        g1: '#94A3B8',
        g2: '#E2E8F0',
      },
      blacks: {
        b1: '#000000',
      },
    },
    paddings: {
      p1: '10%',
      p2: '3%',
    },
  }

  return <div>App</div>
}

export default App
